import "../styles/studentprofile.css";
import { useEffect, useState } from "react";
import axios from 'axios';

function StudentProfile() {
    const [studentData, setStudentData] = useState({
        FirstName: "",
        LastName: "",
        Email: "",
        RollNumber: "",
        Department: "",
        Address: "",
        City: "",
        Semester: "",
        CGPA: ""
    });

    useEffect(() => {
        const fetchStudentData = async () => {
            try {
                const res = await axios.get(`http://localhost:8800/students/${window.localStorage.getItem("userName")}`);
                setStudentData(res.data);
            } catch (err) {
                console.log(err);
            }
        };
        fetchStudentData();
    }, []);

    const handleChange = (e) => {
        const { name, value } = e.target;
        setStudentData(prevState => ({
            ...prevState,
            [name]: value
        }));
    };

    const handleClick = async (e) => {
        e.preventDefault();
        try {
            await axios.put(`http://localhost:8800/students/${studentData.RollNumber}`, studentData);
            alert('Profile updated successfully!');
        } catch (err) {
            console.log(err);
        }
    };

    return (
        <div id="studentP-container">
            <div id="studentP">
                <h1>Profile</h1>
                <div className="form">
                    <label>First Name: </label><input type="text" name="FirstName" placeholder="First Name" value={studentData.FirstName} onChange={handleChange} />
                    <label>Last Name: </label><input type="text" name="LastName" placeholder="Last Name" value={studentData.LastName} onChange={handleChange} />
                    <label>Roll Number: </label><input type="text" name="RollNumber" placeholder="Roll Number" value={studentData.RollNumber} disabled />
                    <label>Email: </label><input type="text" name="Email" placeholder="Email" value={studentData.Email} disabled />
                    <label>Address: </label><input type="text" name="Address" placeholder="Address" value={studentData.Address} onChange={handleChange} />
                    <label>City: </label><input type="text" name="City" placeholder="City" value={studentData.City} onChange={handleChange} />
                    <label>Department: </label><input type="text" name="Department" placeholder="Department" value={studentData.Department} disabled />
                    <label>Semester: </label><input type="text" name="Semester" placeholder="Semester" value={studentData.Semester} onChange={handleChange} />
                    <label>CGPA: </label><input type="text" name="CGPA" placeholder="CGPA" value={studentData.CGPA} onChange={handleChange} />
                    <div className="btnHolder">
                        <button onClick={handleClick}>Update Profile!</button>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default StudentProfile;
